import React from 'react'
import './ask.css';

export default function Questions() {
  return (
    <div className='ask'>
      <h1>Question 1</h1>
      <ul>
        <li>246 experts</li>
        <li>100k+ questions and answers</li>
        <li>50K upvotes</li>
        <li>145 tokens award</li>
      </ul>  
    </div> 
  )
}
